import React from 'react';
import '../assets/css/slideimagesstyle.css';
import {Carousel,Image} from 'react-bootstrap';
import Assets from '../constants/Image';
import Axios from 'axios';


export default class Slideimages extends React.Component{

  componentWillMount(){
    Axios.get('http://180.149.241.208:3022/defaultTopRatingProduct')
    .then(({data}) => {
      console.log('in slideimages::::data----',data);
    })
  }
  render()
  {
    return(
      <div id="forSlideImage"><Carousel className="carousel">
      <Carousel.Item >
        <Image
          className="carouselImage"
          src={Assets.SOFA_IMAGE}
          alt="First slide"
        />
        
      </Carousel.Item>
      <Carousel.Item>
        <Image
          className="carouselImage"
          src={Assets.CHAIR_IMAGE}
          alt="Third slide"
        />
    
       
      </Carousel.Item>
      <Carousel.Item>
        <Image
          className="carouselImage"
          src={Assets.HALL_IMAGE}
          alt="Third slide"
        />
    
        
      </Carousel.Item>
     

    </Carousel></div>
      
  );
  }
    
}
